window.bookSummaryJSON = "<p><b>Return to the captivating world of Elfhame with this addition to the </b><b><i>New York Times </i></b><b>best-selling Folk of Air trilogy that began with </b><b><i>The Cruel Prince</i></b><b>, from award-winning author Holly Black. </b></p> <p><b><i>Once upon a time, there was a boy with a wicked tongue. </i></b></p> <p>Before he was a cruel prince or a wicked king, he was a faerie child with a heart of stone. Number one <i>New York Times</i> best-selling author Holly Black reveals a deeper look into the dramatic life of Elfhame's enigmatic high king, Cardan. This tale includes delicious details of life before <i>The Cruel Prince</i>, an adventure beyond <i>The Queen of Nothing</i>, and familiar moments from the Folk of the Air trilogy, told wholly from Cardan's perspective.</p> <p>This new installment in the Folk of the Air series is a return to the heart-racing romance, danger, humor, and drama that enchanted listeners everywhere. </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
